import React from 'react';
import './App.css';
import axios from 'axios';
import XMLParser from 'react-xml-parser';


function Xml() {
    return (
        <div className='Parentbox'>
            <h1>Halaman XML</h1>
            <table border="1">
                <tr>
                    <th>id</th>
                    <th>name</th>
                    <th>price</th>
                </tr>
                <tr>
                    <th>1</th>
                    <th>1</th>
                    <th>1</th>
                </tr>
            </table>
        </div>
    );
}

export default Xml;
